// import Card from './Card'

export default function App() {
    const colors = [
        <h3>Red</h3>, 
        <h3>Orange</h3>, 
        <h3>Yellow</h3>, 
        <h3>Green</h3>, 
        <h3>Blue</h3>, 
        <h3>Indigo</h3>, 
        <h3>Violet</h3>
    ]
    const colorList = colors.map(color => `<h3>${color}</h3>`)
    console.log(colorList)
    return (
        <div>
            {colors}
        </div>
    )

}


